import { useState, useEffect } from "react";

const ContactList = () => {
    const [data,setData] = useState()
    return(
        <div className="contactList">
            useEffect(() = {
                fetch("http://localhost:3030/contacts")
                .then(res => {
                    setData(res.json())
                })
            },[])
        </div>
    )
}
export default ContactList
